import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import AddAirplane from './pages/AddAirplane';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/add-airplane" element={<AddAirplane />} />
          <Route path="/" element={
            <div className="bg-gray-50 min-h-screen p-8">
              <h1 className="text-3xl font-bold mb-8">Airline Management System</h1>
              <div className="bg-white p-6 rounded-lg shadow-sm max-w-2xl mx-auto">
                <h2 className="text-xl font-semibold mb-4">Dashboard</h2>
                <div className="space-y-4">
                  <Link to="/add-airplane" className="block p-4 bg-blue-50 hover:bg-blue-100 rounded-md">
                    <div className="flex items-center">
                      <svg className="w-6 h-6 mr-2" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                        <path d="M12 5V19" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
                        <path d="M5 12H19" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
                      </svg>
                      <span>Add Airplane</span>
                    </div>
                  </Link>
                </div>
              </div>
            </div>
          } />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
